The main people involved in the Mapp v. Ohio case were:

1. Dollree Mapp - the defendant who was accused of possessing obscene materials;
2. Ernesto Miranda - whose case led to the landmark Miranda v. Arizona decision by the Supreme Court later on;
3. Lawrence A. Speiser and A.L. Kearns - the lawyers who represented Mapp before the Supreme Court;
4. Cleveland police officers who conducted an illegal search of Mapp's home looking for evidence against someone else;
5. Ohio prosecutor John T. Corrigan.
